import React, { useState } from 'react';
import { Box, Container, Grid, Typography, Tabs, Tab } from '@mui/material';
import { motion } from 'framer-motion';

// Mock data for food items
const foodItems = [
  { id: 1, name: 'Biriyani', type: 'non-veg', price: 250, image: 'biriyani.jpg' },
  { id: 2, name: 'Masala Dosa', type: 'veg', price: 120, image: 'dosa.jpg' },
  // Add more items here
];

const beverages = [
  { id: 1, name: 'Kerala Coffee', price: 40, image: 'coffee.jpg' },
  { id: 2, name: 'Masala Chai', price: 30, image: 'tea.jpg' },
  // Add more beverages here
];

const HomePage = () => {
  const [filter, setFilter] = useState('all');

  const handleFilterChange = (event, newValue) => {
    setFilter(newValue);
  };

  const filteredItems = foodItems.filter(item => 
    filter === 'all' ? true : item.type === filter
  );

  return (
    <Container maxWidth="lg" sx={{ py: 4 }}>
      <motion.div
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.5 }}
      >
        <Typography variant="h3" component="h1" gutterBottom>
          Thalassery Restaurant
        </Typography>

        <Box sx={{ borderBottom: 1, borderColor: 'divider', mb: 4 }}>
          <Tabs value={filter} onChange={handleFilterChange}>
            <Tab label="All" value="all" />
            <Tab label="Vegetarian" value="veg" />
            <Tab label="Non-Vegetarian" value="non-veg" />
          </Tabs>
        </Box>

        <Grid container spacing={4}>
          <Grid item xs={12} md={8}>
            <Typography variant="h5" gutterBottom>
              Menu Items
            </Typography>
            <Grid container spacing={2}>
              {filteredItems.map(item => (
                <Grid item xs={12} sm={6} key={item.id}>
                  <motion.div
                    whileHover={{ scale: 1.05 }}
                    transition={{ type: "spring", stiffness: 300 }}
                  >
                    {/* Food item card component will go here */}
                    <Box sx={{ p: 2, border: '1px solid #eee', borderRadius: 2 }}>
                      <Typography variant="h6">{item.name}</Typography>
                      <Typography>₹{item.price}</Typography>
                    </Box>
                  </motion.div>
                </Grid>
              ))}
            </Grid>
          </Grid>

          <Grid item xs={12} md={4}>
            <Typography variant="h5" gutterBottom>
              Beverages
            </Typography>
            <Grid container spacing={2}>
              {beverages.map(beverage => (
                <Grid item xs={12} key={beverage.id}>
                  <motion.div
                    whileHover={{ scale: 1.05 }}
                    transition={{ type: "spring", stiffness: 300 }}
                  >
                    {/* Beverage card component will go here */}
                    <Box sx={{ p: 2, border: '1px solid #eee', borderRadius: 2 }}>
                      <Typography variant="h6">{beverage.name}</Typography>
                      <Typography>₹{beverage.price}</Typography>
                    </Box>
                  </motion.div>
                </Grid>
              ))}
            </Grid>
          </Grid>
        </Grid>
      </motion.div>
    </Container>
  );
};

export default HomePage;
